window.bookSummaryJSON = "<p>....Champion of Aros, God of Battle....</p> <p>....Bearer of foreknowledge....</p> <p>....A mythical third realm expert....</p> <p>Jason had it all, and yet he still couldn't prevent his father's death. He didn't even have time to grieve as his mission took precedence over all else. Pressing onward was the only path. But did he possess enough strength to clear the tower, even with Roy and Olivia at his back?</p> <p>The answer was obvious: Only with humanity's best could he stand a fighting chance.</p> <p>Yet as his actions influenced the world, the more things changed. Worse, his secret identity, Index, was in the spotlight for releasing knowledge that couldn't possibly be known. If the major powers of the world found him, they'd no doubt use torture to obtain his secrets.</p> <p>A single mistake would cost everything.</p> <p>He already got a second chance.</p> <p>He won't get a third.</p>"; 
